import React, { useState } from 'react';
import './nav_bar.css';

const NavBar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isSubMenu1Open, setIsSubMenu1Open] = useState(false);
  const [isSubMenu2Open, setIsSubMenu2Open] = useState(false);
  const [isSubMenu3Open, setIsSubMenu3Open] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const toggleSubMenu1 = () => {
    setIsSubMenu1Open(!isSubMenu1Open);
  };

  const toggleSubMenu2 = () => {
    setIsSubMenu2Open(!isSubMenu2Open);
  };

  const toggleSubMenu3 = () => {
    setIsSubMenu3Open(!isSubMenu3Open);
  };

  return (
    <div className="navbar">
      <div className="menu-button-container">
        <button onClick={toggleMenu}>
          <span>{isMenuOpen ? '▲' : '▼'}</span>
        </button>
      </div>
      {isMenuOpen && (
        <ul className={`menu ${isMenuOpen ? 'open' : ''}`}>
          <li>
            <button>Button 1</button>
          </li>
          <li>
            <button>Button 2</button>
          </li>
          <li>
            <button onClick={toggleSubMenu1}>
              Submenu 1 {isSubMenu1Open ? '▲' : '▼'}
            </button>
            {isSubMenu1Open && (
              <ul className="submenu">
                <li>
                  <button>Submenu 1-1</button>
                </li>
                <li>
                  <button>Submenu 1-2</button>
                </li>
                <li>
                  <button>Submenu 1-3</button>
                </li>
              </ul>
            )}
          </li>
          <li>
            <button onClick={toggleSubMenu2}>
              Submenu 2 {isSubMenu2Open ? '▲' : '▼'}
            </button>
            {isSubMenu2Open && (
              <ul className="submenu">
                <li>
                  <button>Submenu 2-1</button>
                </li>
                <li>
                  <button>Submenu 2-2</button>
                </li>
                <li>
                  <button>Submenu 2-3</button>
                </li>
              </ul>
            )}
          </li>
          <li>
            <button onClick={toggleSubMenu3}>
              Submenu 3 {isSubMenu3Open ? '▲' : '▼'}
            </button>
            {isSubMenu3Open && (
              <ul className="submenu">
                <li>
                  <button>Submenu 3-1</button>
                </li>
                <li>
                  <button>Submenu 3-2</button>
                </li>
                <li>
                  <button>Submenu 3-3</button>
                </li>
              </ul>
            )}
          </li>
          <li>
            <button>Button 3</button>
          </li>
          <li>
            <button>Button 4</button>
          </li>
          <li>
            <button>Button 5</button>
          </li>
          <li>
            <button>Button 6</button>
          </li>
          <li>
            <button>Button 7</button>
          </li>
          <li>
            <button>Button 8</button>
          </li>
          <li>
            <button>Button 9</button>
          </li>
          <li>
            <button>Button 10</button>
          </li>
        </ul>
      )}
    </div>
  );
};

export default NavBar;
